import './styles.scss';

const Footer = props => {
  return (
    <div className='footer'>
      <p> Full conversation with Lachlan available at <a href='https://bjj.plus/102'>BJJ Mental Models</a>.</p>

      <p> Thank you to the BJJ Mental Models community for their amazing work and support, and KenTheNinja for suggesting this project. </p>
    </div>
  );
};

export default Footer;
